import 'package:adventuraclick_mobile/model/location.dart';
import 'package:adventuraclick_mobile/model/travel.dart';
import 'package:adventuraclick_mobile/model/travel_type.dart';

var travelData = [
    {
      "travelId": 3,
      "description": "description123123",
      "name": "Trip 1",
      "date": "2023-09-26T19:36:28.618Z",
      "price": 100.3,
      "location":{
        "cityName": "London",
        "countryName": "UK"
      },
      "travelType":{
        "name": "bus"
      },
      "status": "Active",
      "image": "",
    }
  ];

List<Travel> convertMockedDataToTravelList() {
  return travelData.map((json) {
    return Travel()
      ..travelId = json['travelId'] as int?
      ..description = json['description'] as String?
      ..name = json['name'] as String?
      ..status = json['status'] as String?
      ..price = json['price'] as double?
      ..date = DateTime.parse(
          json['date'] as String) // Pretvaranje stringa u DateTime
      ..travelTypeId = json['travelTypeId'] as int?
      ..image = json['image'] as String?
      ..location =
          Location.fromJson(json['location'] as Map<String, dynamic>)
      ..travelType =
          TravelType.fromJson(json['travelType'] as Map<String, dynamic>);
  }).toList();
}
